import styled from "styled-components";

export const Wrapper = styled.div`
	height: 100vh;
	padding: 50px;
	background-image: url(${props => (props.bgUrl ? props.bgUrl : "")});
	background-repeat: no-repeat;
	background-position: center;
	background-size: cover;
	position: relative;
	.gradient {
		position: absolute;
		height: 100vh;
		background: white;
		width: 40%;
		top: 0;
		left: 0;
	}
	.description {
		padding: 30px 0;
		color: white;
		font-size: 1.5em;
	}
`;
